import "./App.css";
import Header from "./Header";
import Sidebar from "./Sidebar";
import RecommendedVideos from "./RecommendedVideos";
import { BrowserRouter as Router,Switch, Route} from "react-router-dom"; 

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/">
            <h1>Home page</h1>
          </Route>
          <Route path="/search">
            <h1>Search page</h1>
          </Route>
        </Switch>
      </Router>


      {/* header */}
      <Header />
      {/* sidebar and mainvideo */}
      <div className="app__page">
        <Sidebar />
        <RecommendedVideos />
      </div>
      {/* sidebar */}
      {/* main */}
    </div>
  );
}

export default App;
